const baseUrl = 'http://0.0.0.0:8003';

export const searchData = (data) => {
    const search_mode = data.search_mode;

    if (search_mode === 'hash') {
        const url = baseUrl + '/search/' + data.input_data;
        console.log('url', url);
    }
};
